We are underpaid, underappreciated and undervalued and I believe that causes a large amount of imposter syndrome in the industry. How can we value ourselves when we are barely valued by others? 
The industry has changed massively but needs to continue to change and evolve as we do. We need our title protected, we need to demand a better wage for the service we provide, we need better public education on our role, we need supportive vets who understand we are a team not just an add on. We need to understand how important our role truly is. It all starts with us, it all starts with believing in ourselves and our job role. We deserve better, we just need to remind ourselves from time to time. You've got this. 

